import React, { useState, useEffect } from 'react';

function App() {
  const [songs, setSongs] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3001/api/songs')
      .then(res => res.json())
      .then(data => setSongs(data))
      .catch(err => console.error("Error fetching songs:", err));
  }, []);

  return (
    <div>
      <header>
        <h1>Spotify Clone</h1>
        <h2>Songs</h2>
        <ul>
          {songs.map(song => (
            <li key={song.id}>
              {song.title} - {song.artist}
            </li>
          ))}
        </ul>
      </header>
    </div>
  );
}

export default App;
